pub fn minimum_length(s: String) -> i32 {
    let mut freq = [0; 26];
    for c in s.chars() {
        let i = c as usize - 'a' as usize;
        freq[i] += if freq[i] < 2 { 1 } else { -1 }
    }
    freq.iter().sum()
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn example_1() {
        let result = minimum_length("abaacbcbb".to_owned());
        assert_eq!(result, 5);
    }

    #[test]
    fn example_2() {
        let result = minimum_length("aa".to_owned());
        assert_eq!(result, 2);
    }

    #[test]
    fn example_3() {
        let result = minimum_length("".to_owned());
        assert_eq!(result, 40)
    }
}
